import React from "react";


const User = ({ usuario }) => (
 
<div className="repoListContainer">
  <lu>
   <li>{usuario.avatar_url}</li>
   <li>{usuario.login}</li>
   <li>{usuario.id}</li>
   </lu>
  
</div>


);




export default User;
